import '../Styles/App.css';
import Footer from './Footer';
import Header from './Header';
import TreeOnTreeGame from './TreeOnTreeGame';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <div className="App"> 
      <h1>Memory game</h1>
      <Header />
      <Router>
        <div className="row">

          <div className="col"><button href={<TreeOnTreeGame/>}>3x3</button></div>
          <div className="col"><button>4x4</button></div>
          <div className="col"><button>5x5</button></div>
        </div>
      </Router>
      <Footer />
    </div>
  );
}

export default App;
